--tabla de Empleado
create table Empleado (
	idEmpleado INT,
	idCargo INT,
	idEstadoCivil INT,
	CI VARCHAR(50),
	primerNombre VARCHAR(50),
	segundoNombre VARCHAR(50),
	apellidoPaterno VARCHAR(50),
	apellidoMaterno VARCHAR(50),
	fechaNacimiendo VARCHAR(50),
	codeRFID VARCHAR(50),
	genero VARCHAR(50),git 
	fotografia VARCHAR(50),
	numeroCelular VARCHAR(50),
	numeroFijo VARCHAR(50),
	usuario VARCHAR(50),
	contraseña VARCHAR(50),
	activo VARCHAR(50)
);

